column8:
★キーンのサンダル！<br>
<br>
●軽量で履き心地に優れたサンダル。<br>
●アッパー部分には上質なフルグレインレザーを採用。<br>
●フットベッドには光沢感のあるレザーを採用。<br>
●アウトソールは花柄をモチーフが施した、フェミニンなデザイン。<br>
●タウンユースや旅先でのおしゃれを楽しむのにおすすめの一足です。<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■サイズ 24.5cm、25.0cm<br>
